import{_ as s,c as n,o as a,a as l}from"./app.a19aada9.js";const e='{"title":"Component Instance","description":"","frontmatter":{},"headers":[{"level":2,"title":"$data","slug":"data"},{"level":2,"title":"$props","slug":"props"},{"level":2,"title":"$el","slug":"el"},{"level":2,"title":"$options","slug":"options"},{"level":2,"title":"$parent","slug":"parent"},{"level":2,"title":"$root","slug":"root"},{"level":2,"title":"$slots","slug":"slots"},{"level":2,"title":"$refs","slug":"refs"},{"level":2,"title":"$attrs","slug":"attrs"},{"level":2,"title":"$watch()","slug":"watch"},{"level":2,"title":"$emit()","slug":"emit"},{"level":2,"title":"$forceUpdate()","slug":"forceupdate"},{"level":2,"title":"$nextTick()","slug":"nexttick"}],"relativePath":"api/component-instance.md"}',o={},p=[l('<div class="warning custom-block"><p class="custom-block-title">현재 이 문서는 번역 작업이 진행중입니다</p></div><h1 id="component-instance" tabindex="-1">Component Instance <a class="header-anchor" href="#component-instance" aria-hidden="true">#</a></h1><h1 id="컴포넌트-인스턴스" tabindex="-1">컴포넌트 인스턴스 <a class="header-anchor" href="#컴포넌트-인스턴스" aria-hidden="true">#</a></h1><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This page documents the built-in properties and methods exposed on the component public instance, i.e. <code>this</code>.</p><p>All properties listed on this page are readonly (except nested properties in <code>$data</code>).</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>이 페이지는 컴포넌트 공개(Public) 인스턴스(예: <code>this</code>)에서 제공되는 내장 속성 및 메소드를 문서화합니다.</p><p>All properties listed on this page are readonly (except nested properties in <code>$data</code>).</p><p>이 페이지에 나열된 모든 속성은 읽기 전용입니다(<code>$data</code>의 중첩 속성 제외).</p></div><h2 id="data" tabindex="-1">$data <a class="header-anchor" href="#data" aria-hidden="true">#</a></h2><p>The object returned from the <a href="./options-state.html#data"><code>data</code></a> option, made reactive by the component. The component instance proxies access to the properties on its data object.</p><p><a href="./options-state.html#data"><code>data</code></a> 옵션에서 반환된 객체는 컴포넌트에 의해 반응형 객체로 변환됩니다. 컴포넌트 인스턴스는 데이터 개체의 속성들에 접근할때 이 접근을 프록시하여 제공합니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$data</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">object</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li></ul><h2 id="props" tabindex="-1">$props <a class="header-anchor" href="#props" aria-hidden="true">#</a></h2><p>An object representing the component&#39;s current, resolved props.</p><p>컴포넌트의 현재 해결된 props을 나타내는 개체입니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$props</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">object</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>Details</strong></p><p>Only props declared via the <a href="./options-state.html#props"><code>props</code></a> option will be included. The component instance proxies access to the properties on its props object.</p><p><a href="./options-state.html#props"><code>props</code></a> 옵션을 통해 선언된 props만 포함됩니다. 컴포넌트 인스턴스는 props 개체의 속성들에 접근할때 이 접근을 프록시하여 제공합니다.</p></li></ul><h2 id="el" tabindex="-1">$el <a class="header-anchor" href="#el" aria-hidden="true">#</a></h2><p>The root DOM node that the component instance is managing.</p><p>컴포넌트 인스턴스가 관리하는 루트 DOM 노드입니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$el</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">Node</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">undefined</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>Details</strong></p><p><code>$el</code> will be <code>undefined</code> until the component is <a href="./options-lifecycle.html#mounted">mounted</a>.</p><p><code>$el</code>은 컴포넌트가 <a href="./options-lifecycle.html#mounted">mounted</a>될 때까지 <code>undefined</code>입니다.</p><ul><li>For components with a single root element, <code>$el</code> will point to that element.</li><li>단일 루트엘리먼트가 있는 컴포넌트의 경우 <code>$el</code>은 해당엘리먼트를 가리킵니다.</li><li></li><li>For components with text root, <code>$el</code> will point to the text node.</li><li>텍스트 루트가 있는 컴포넌트의 경우 <code>$el</code>은 텍스트 노드를 가리킵니다.</li><li></li><li>For components with multiple root nodes, <code>$el</code> will be the placeholder DOM node that Vue uses to keep track of the component&#39;s position in the DOM (a text node, or a comment node in SSR hydration mode).</li><li>여러 루트 노드가 있는 컴포넌트의 경우 <code>$el</code>은 Vue가 DOM(텍스트 노드 또는 SSR 수화 모드의 주석 노드)에서 컴포넌트의 위치를 ​​추적하는 데 사용하는 자리 표시자 DOM 노드입니다.</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>For consistency, its is recommended to use <a href="/guide/essentials/template-refs.html">template refs</a> for direct access to elements instead of relying on <code>$el</code>.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>일관성을 위해 <code>$el</code>에 의존하는 대신엘리먼트에 직접 액세스할 때 <a href="/guide/essentials/template-refs.html">템플릿 refs</a>를 사용하는 것이 좋습니다.</p></div></li></ul><h2 id="options" tabindex="-1">$options <a class="header-anchor" href="#options" aria-hidden="true">#</a></h2><p>The resolved component options used for instantiating the current component instance.</p><p>현재 컴포넌트 인스턴스를 인스턴스화하는 데 사용되는 확인된 컴포넌트 옵션입니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$options</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentOptions</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>Details</strong></p><p>The <code>$options</code> object exposes the resolved options for the current component and is the merge result of these possible sources:</p><p><code>$options</code> 객체는 현재 컴포넌트에 대한 해결된 옵션을 노출하며 다음과 같은 가능한 소스의 병합 결과입니다.</p><ul><li><p>Global mixins</p></li><li><p>전역 믹스인</p></li><li><p>Component <code>extends</code> base</p></li><li><p>컴포넌트 <code>extends</code> 기반</p></li><li><p>Component mixins</p></li><li><p>컴포넌트 믹스인</p></li></ul><p>It is typically used to support custom component options: 일반적으로 사용자 지정 컴포넌트 옵션을 지원하는 데 사용됩니다.</p><div class="language-js"><pre><code><span class="line"><span style="color:#C792EA;">const</span><span style="color:#A6ACCD;"> app </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#82AAFF;">createApp</span><span style="color:#A6ACCD;">(</span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">customOption</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">foo</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">,</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">created</span><span style="color:#89DDFF;">()</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#F07178;">    </span><span style="color:#A6ACCD;">console</span><span style="color:#89DDFF;">.</span><span style="color:#82AAFF;">log</span><span style="color:#F07178;">(</span><span style="color:#89DDFF;">this.</span><span style="color:#A6ACCD;">$options</span><span style="color:#89DDFF;">.</span><span style="color:#A6ACCD;">customOption</span><span style="color:#F07178;">) </span><span style="color:#676E95;font-style:italic;">// =&gt; &#39;foo&#39;</span></span>\n<span class="line"><span style="color:#F07178;">  </span><span style="color:#89DDFF;">}</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span><span style="color:#A6ACCD;">)</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>See also:</strong> <a href="/api/application.html#app-config-optionmergestrategies"><code>app.config.optionMergeStrategies</code></a></p></li><li><p><strong>참조:</strong> <a href="/api/application.html#app-config-optionmergestrategies"><code>app.config.optionMergeStrategies</code></a></p></li></ul><h2 id="parent" tabindex="-1">$parent <a class="header-anchor" href="#parent" aria-hidden="true">#</a></h2><p>The parent instance, if the current instance has one. It will be <code>null</code> for the root instance itself.</p><p>현재 인스턴스에 상위 인스턴스가 있는 경우 상위 인스턴스입니다. 루트 인스턴스 자체에 대해서는 &#39;null&#39;이 됩니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$parent</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">null</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li></ul><h2 id="root" tabindex="-1">$root <a class="header-anchor" href="#root" aria-hidden="true">#</a></h2><p>The root component instance of the current component tree. If the current instance has no parents this value will be itself.</p><p>현재 컴포넌트 트리의 루트 컴포넌트 인스턴스입니다. 현재 인스턴스에 상위 항목이 없으면 이 값 자체가 됩니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$root</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li></ul><h2 id="slots" tabindex="-1">$slots <a class="header-anchor" href="#slots" aria-hidden="true">#</a></h2><p>An object representing the <a href="/guide/components/slots.html">slots</a> passed by the parent component.</p><p>상위 컴포넌트에 의해 전달된 <a href="/guide/components/slots.html">슬롯</a>을 나타내는 개체입니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$slots</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span><span style="color:#A6ACCD;"> [name</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">string</span><span style="color:#A6ACCD;">]</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">Slot</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">}</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#C792EA;">type</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">Slot</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">(...</span><span style="color:#A6ACCD;">args</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">any</span><span style="color:#A6ACCD;">[]</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">VNode</span><span style="color:#A6ACCD;">[]</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>Details</strong></p><p>Typically used when manually authoring <a href="/guide/extras/render-function.html">render functions</a>, but can also be used to detect whether a slot is present.</p><p>일반적으로 <a href="/guide/extras/render-function.html">render functions</a>를 수동으로 작성할 때 사용되지만 슬롯이 있는지 여부를 감지하는 데에도 사용할 수 있습니다.</p><p>Each slot is exposed on <code>this.$slots</code> as a function that returns an array of vnodes under the key corresponding to that slot&#39;s name. The default slot is exposed as <code>this.$slots.default</code>.</p><p>각 슬롯은 해당 슬롯의 이름에 해당하는 키 아래에 vnode 배열을 반환하는 함수로 <code>this.$slots</code>에 노출됩니다. 기본 슬롯은 <code>this.$slots.default</code>로 표시됩니다.</p><p>If a slot is a <a href="/guide/components/slots.html#scoped-slots">scoped slot</a>, arguments passed to the slot functions are available to the slot as its slot props.</p><p>슬롯이 <a href="/guide/components/slots.html#scoped-slots">범위가 지정된 슬롯</a>인 경우 슬롯 함수에 전달된 인자는 슬롯 소품으로 슬롯에 사용할 수 있습니다.</p></li><li><p><strong>See also:</strong> <a href="/guide/extras/render-function.html#rendering-slots">Render Functions - Rendering Slots</a></p></li><li><p><strong>See also:</strong> <a href="/guide/extras/render-function.html#rendering-slots">렌더링 함수 - 슬롯 렌더링</a></p></li></ul><h2 id="refs" tabindex="-1">$refs <a class="header-anchor" href="#refs" aria-hidden="true">#</a></h2><p>An object of DOM elements and component instances, registered via <a href="/guide/essentials/template-refs.html">template refs</a>.</p><p><a href="/guide/essentials/template-refs.html">템플릿 참조</a>를 통해 등록된 DOM엘리먼트 및 컴포넌트 인스턴스의 개체입니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$refs</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span><span style="color:#A6ACCD;"> [name</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">string</span><span style="color:#A6ACCD;">]</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">Element</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">null</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">}</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>See also:</strong></p><ul><li><a href="/guide/essentials/template-refs.html">Template refs</a></li><li><a href="./built-in-special-attributes.html#ref">Special Attributes - ref</a></li></ul></li></ul><h2 id="attrs" tabindex="-1">$attrs <a class="header-anchor" href="#attrs" aria-hidden="true">#</a></h2><p>An object that contains the component&#39;s fallthrough attributes.</p><p>컴포넌트의 대체 속성이 포함된 개체입니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$attrs</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">object</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>Details</strong></p><p><a href="/guide/components/attrs.html">Fallthrough Attributes</a> are attributes and event handlers passed by the parent component, but not declared as a prop or a emitted event by the child.</p><p><a href="/guide/components/attrs.html">폴스루 속성</a>은 상위 구성앨리먼트에 의해 전달된 속성 및 이벤트 핸들러이지만 하위엘리먼트 또는 내보낸 이벤트로 선언되지 않습니다.</p><p>By default, everything in <code>$attrs</code> will be automatically inherited on the component&#39;s root element if there is only a single root element. This behavior is disabled if the component has multiple root nodes, and can be explicitly disabled with the <a href="./options-misc.html#inheritattrs"><code>inheritAttrs</code></a> option.</p><p>기본적으로 <code>$attrs</code>의 모든 항목은 단일 루트엘리먼트만 있는 경우 컴포넌트의 루트엘리먼트에서 자동으로 상속됩니다. 이 동작은 컴포넌트에 여러 루트 노드가 있는 경우 비활성화되며 <a href="./options-misc.html#inheritattrs"><code>inheritAttrs</code></a> 옵션을 사용하여 명시적으로 비활성화할 수 있습니다.</p></li><li><p><strong>See also:</strong></p><ul><li><a href="/guide/components/attrs.html">Fallthrough Attributes</a></li><li><a href="/guide/components/attrs.html">폴스루 속성</a></li></ul></li></ul><h2 id="watch" tabindex="-1">$watch() <a class="header-anchor" href="#watch" aria-hidden="true">#</a></h2><p>Imperative API for creating watchers.</p><p>watcher를 생성하기 위한 명령형 API.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$watch</span><span style="color:#89DDFF;">(</span></span>\n<span class="line"><span style="color:#A6ACCD;">    source</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">string</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> (</span><span style="color:#89DDFF;">()</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">any</span><span style="color:#A6ACCD;">)</span><span style="color:#89DDFF;">,</span></span>\n<span class="line"><span style="color:#A6ACCD;">    callback</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">WatchCallback</span><span style="color:#89DDFF;">,</span></span>\n<span class="line"><span style="color:#A6ACCD;">    options</span><span style="color:#89DDFF;">?:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">WatchOptions</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">):</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">StopHandle</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#C792EA;">type</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">WatchCallback</span><span style="color:#89DDFF;">&lt;</span><span style="color:#FFCB6B;">T</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> (</span></span>\n<span class="line"><span style="color:#A6ACCD;">  value</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">T</span><span style="color:#89DDFF;">,</span></span>\n<span class="line"><span style="color:#A6ACCD;">  oldValue</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">T</span><span style="color:#89DDFF;">,</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#82AAFF;">onCleanup</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">(</span><span style="color:#82AAFF;">cleanupFn</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">()</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">void</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">void</span></span>\n<span class="line"><span style="color:#A6ACCD;">) </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">void</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">WatchOptions</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">immediate</span><span style="color:#89DDFF;">?:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">boolean</span><span style="color:#A6ACCD;"> </span><span style="color:#676E95;font-style:italic;">// default: false</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">deep</span><span style="color:#89DDFF;">?:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">boolean</span><span style="color:#A6ACCD;"> </span><span style="color:#676E95;font-style:italic;">// default: false</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">flush</span><span style="color:#89DDFF;">?:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">pre</span><span style="color:#89DDFF;">&#39;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">post</span><span style="color:#89DDFF;">&#39;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">sync</span><span style="color:#89DDFF;">&#39;</span><span style="color:#A6ACCD;"> </span><span style="color:#676E95;font-style:italic;">// default: &#39;pre&#39;</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">onTrack</span><span style="color:#89DDFF;">?:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;">event</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">DebuggerEvent</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">void</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">onTrigger</span><span style="color:#89DDFF;">?:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;">event</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">DebuggerEvent</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">void</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#C792EA;">type</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">StopHandle</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">()</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">void</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>Details</strong></p><p>The first argument is the watch source. It can be a component property name string, a simple dot-delimited path string, or a getter function.</p><p>첫 번째 인자는 감시 소스입니다. 컴포넌트 속성 이름 문자열, 점으로 구분된 간단한 경로 문자열 또는 getter 함수일 수 있습니다.</p><p>The second argument is the callback function. The callback receives the new value and the old value of the watched source.</p><p>두 번째 인자는 콜백 함수입니다. 콜백은 감시된 소스의 새 값과 이전 값을 수신합니다.</p><ul><li><p><strong><code>immediate</code></strong>: trigger the callback immediately on watcher creation. Old value will be <code>undefined</code> on the first call.</p></li><li><p><strong><code>immediate</code></strong>: 감시자가 생성되는 즉시 콜백을 트리거합니다. 이전 값은 첫 번째 호출에서 &#39;정의되지 않음&#39;입니다.</p></li><li><p><strong><code>deep</code></strong>: force deep traversal of the source if it is an object, so that the callback fires on deep mutations. See <a href="/guide/essentials/watchers.html#deep-watchers">Deep Watchers</a>.</p></li><li><p><strong><code>deep</code></strong>: 소스가 객체인 경우 소스의 깊은 순회를 강제 실행하여 콜백이 깊은 돌연변이에서 실행되도록 합니다. <a href="/guide/essentials/watchers.html#deep-watchers">Deep Watchers</a>를 참조하세요.</p></li><li><p><strong><code>flush</code></strong>: adjust the callback&#39;s flush timing. See <a href="/guide/essentials/watchers.html#callback-flush-timing">Callback Flush Timing</a>.</p></li><li><p><strong><code>flush</code></strong>: 콜백의 플러시 타이밍을 조정합니다. <a href="/guide/essentials/watchers.html#callback-flush-timing">콜백 플러시 타이밍</a>을 참조하세요.</p></li><li><p><strong><code>onTrack / onTrigger</code></strong>: debug the watcher&#39;s dependencies. See <a href="/guide/extras/reactivity-in-depth.html#watcher-debugging">Watcher Debugging</a>.</p></li><li><p><strong><code>onTrack / onTrigger</code></strong>: 감시자의 종속성을 디버그합니다. <a href="/guide/extras/reactivity-in-depth.html#watcher-debugging">감시자 디버깅</a>을 참조하세요.</p></li></ul></li><li><p><strong>Example</strong></p><p>Watch a property name:</p><p>속성 이름을 감시:</p><div class="language-js"><pre><code><span class="line"><span style="color:#89DDFF;">this.</span><span style="color:#82AAFF;">$watch</span><span style="color:#A6ACCD;">(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">a</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;">newVal</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> oldVal</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{}</span><span style="color:#A6ACCD;">)</span></span>\n<span class="line"></span></code></pre></div><p>Watch a dot-delimited path:</p><p>점 구분자 경로를 감시:</p><div class="language-js"><pre><code><span class="line"><span style="color:#89DDFF;">this.</span><span style="color:#82AAFF;">$watch</span><span style="color:#A6ACCD;">(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">a.b</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;">newVal</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> oldVal</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{}</span><span style="color:#A6ACCD;">)</span></span>\n<span class="line"></span></code></pre></div><p>Using getter for more complex expressions:</p><p>더 복잡한 경우를 추적하기 위해 getter를 사용</p><div class="language-js"><pre><code><span class="line"><span style="color:#89DDFF;">this.</span><span style="color:#82AAFF;">$watch</span><span style="color:#A6ACCD;">(</span></span>\n<span class="line"><span style="color:#89DDFF;">  </span><span style="color:#676E95;font-style:italic;">// every time the expression `this.a + this.b` yields</span></span>\n<span class="line"><span style="color:#89DDFF;">  </span><span style="color:#676E95;font-style:italic;">// a different result, the handler will be called.</span></span>\n<span class="line"><span style="color:#89DDFF;">  </span><span style="color:#676E95;font-style:italic;">// It&#39;s as if we were watching a computed property</span></span>\n<span class="line"><span style="color:#89DDFF;">  </span><span style="color:#676E95;font-style:italic;">// without defining the computed property itself.</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">()</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">this.</span><span style="color:#A6ACCD;">a </span><span style="color:#89DDFF;">+</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">this.</span><span style="color:#A6ACCD;">b</span><span style="color:#89DDFF;">,</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;">newVal</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> oldVal</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{}</span></span>\n<span class="line"><span style="color:#A6ACCD;">)</span></span>\n<span class="line"></span></code></pre></div><p>Stopping the watcher:</p><p>watcher 중지 시키기:</p><div class="language-js"><pre><code><span class="line"><span style="color:#C792EA;">const</span><span style="color:#A6ACCD;"> unwatch </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">this.</span><span style="color:#82AAFF;">$watch</span><span style="color:#A6ACCD;">(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">a</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> cb)</span></span>\n<span class="line"></span>\n<span class="line"><span style="color:#676E95;font-style:italic;">// later...</span></span>\n<span class="line"><span style="color:#82AAFF;">unwatch</span><span style="color:#A6ACCD;">()</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>See also:</strong></p><ul><li><a href="/api/options-state.html#watch">Options - <code>watch</code></a></li><li><a href="/guide/essentials/watchers.html">Guide - Watchers</a></li></ul></li></ul><h2 id="emit" tabindex="-1">$emit() <a class="header-anchor" href="#emit" aria-hidden="true">#</a></h2><p>Trigger a custom event on the current instance. Any additional arguments will be passed into the listener&#39;s callback function.</p><p>현재 인스턴스에서 사용자 정의 이벤트를 트리거합니다. 추가 인자는 리스너의 콜백 함수로 전달됩니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$emit</span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;">event</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">string</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">...</span><span style="color:#A6ACCD;">args</span><span style="color:#89DDFF;">:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">any</span><span style="color:#A6ACCD;">[]</span><span style="color:#89DDFF;">):</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">void</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>Example</strong></p><div class="language-js"><pre><code><span class="line"><span style="color:#89DDFF;font-style:italic;">export</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;font-style:italic;">default</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">created</span><span style="color:#89DDFF;">()</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#89DDFF;">    </span><span style="color:#676E95;font-style:italic;">// only event</span></span>\n<span class="line"><span style="color:#F07178;">    </span><span style="color:#89DDFF;">this.</span><span style="color:#82AAFF;">$emit</span><span style="color:#F07178;">(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">foo</span><span style="color:#89DDFF;">&#39;</span><span style="color:#F07178;">)</span></span>\n<span class="line"><span style="color:#89DDFF;">    </span><span style="color:#676E95;font-style:italic;">// with additional arguments</span></span>\n<span class="line"><span style="color:#F07178;">    </span><span style="color:#89DDFF;">this.</span><span style="color:#82AAFF;">$emit</span><span style="color:#F07178;">(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">bar</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">,</span><span style="color:#F07178;"> </span><span style="color:#F78C6C;">1</span><span style="color:#89DDFF;">,</span><span style="color:#F07178;"> </span><span style="color:#F78C6C;">2</span><span style="color:#89DDFF;">,</span><span style="color:#F07178;"> </span><span style="color:#F78C6C;">3</span><span style="color:#F07178;">)</span></span>\n<span class="line"><span style="color:#F07178;">  </span><span style="color:#89DDFF;">}</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>See also:</strong></p><ul><li><a href="/guide/components/events.html">Component - Events</a></li><li><a href="./options-state.html#emits"><code>emits</code> option</a></li></ul></li></ul><h2 id="forceupdate" tabindex="-1">$forceUpdate() <a class="header-anchor" href="#forceupdate" aria-hidden="true">#</a></h2><p>Force the component instance to re-render.</p><p>컴포넌트 인스턴스를 강제로 다시 렌더링합니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$forceUpdate</span><span style="color:#89DDFF;">():</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">void</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>Details</strong></p><p>This should be rarely needed given Vue&#39;s fully automatic reactivity system. The only cases where you may need it is when you have explicitly created non-reactive component state using advanced reactivity APIs.</p><p>Vue의 완전 자동 반응성 시스템을 고려할 때 이것은 거의 필요하지 않습니다. 필요할 수 있는 유일한 경우는 고급 반응성 API를 사용하여 비반응성 컴포넌트 상태를 명시적으로 생성한 경우입니다.</p></li></ul><h2 id="nexttick" tabindex="-1">$nextTick() <a class="header-anchor" href="#nexttick" aria-hidden="true">#</a></h2><p>Instance-bound version of the global <a href="./general.html#nexttick"><code>nextTick()</code></a>.</p><p>전역 <a href="./general.html#nexttick"><code>nextTick()</code></a>의 인스턴스 바인딩 버전입니다.</p><ul><li><p><strong>Type</strong></p><div class="language-ts"><pre><code><span class="line"><span style="color:#C792EA;">interface</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">{</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#F07178;">$nextTick</span><span style="color:#89DDFF;">(</span><span style="color:#82AAFF;">callback</span><span style="color:#89DDFF;">?:</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">(this:</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">ComponentPublicInstance</span><span style="color:#89DDFF;">)</span><span style="color:#A6ACCD;"> </span><span style="color:#C792EA;">=&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">void</span><span style="color:#89DDFF;">):</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">Promise</span><span style="color:#89DDFF;">&lt;</span><span style="color:#FFCB6B;">void</span><span style="color:#89DDFF;">&gt;</span></span>\n<span class="line"><span style="color:#89DDFF;">}</span></span>\n<span class="line"></span></code></pre></div></li><li><p><strong>Details</strong></p><p>The only difference from the global version of <code>nextTick()</code> is that the callback passed to <code>this.$nextTick()</code> will have its <code>this</code> context bound to the current component instance.</p><p><code>nextTick()</code>의 글로벌 버전과 유일한 차이점은 <code>this.$nextTick()</code>에 전달된 콜백이 현재 컴포넌트 인스턴스에 바인딩된 <code>this</code> 컨텍스트를 갖는다는 것입니다.</p></li><li><p><strong>See also:</strong> <a href="./general.html#nexttick"><code>nextTick()</code></a></p></li></ul>',57)];var t=s(o,[["render",function(s,l,e,o,t,c){return a(),n("div",null,p)}]]);export{e as __pageData,t as default};
